pragma solidity ^0.4.24;

import "../lib/PublicResolver.sol";
import "../lib/Ownable.sol";

/**
 * A resolver managed by a company with functional data of a company.
 */
contract KomgoResolver is PublicResolver, Ownable {

    bytes4 constant NODE_KEYS_INTERFACE_ID = 0x8ebb091c;
    bytes4 constant SIGNING_KEYS_INTERFACE_ID = 0x9beefbde;

    event NodeKeysChanged(bytes32 indexed _node, string _nodeKeys);
    event SigningKeyAdded(bytes32 indexed _node, bytes32 _xPublicKey, bytes32 _yPublicKey, uint _termDate);
    event SigningKeyRevoked(bytes32 indexed _node, uint _index);

    struct Key {
        PublicKey publicKey;
        uint effDate;
        uint termDate;
        bool revoked;
    }

    struct KomgoRecord {
        string nodeKeys;
        uint currentSigningKeyIndex;
        Key[] signingKeys;
    }

    mapping (bytes32 => KomgoRecord) komgoRecords;

    modifier komgoOrOwner(bytes32 _node) {
        require(
            owner == msg.sender ||
            ens.owner(_node) == msg.sender);
        _;
    }

    constructor(ENS _ensAddr) PublicResolver(_ensAddr) public {}

    /**
     * Sets the node keys associated with an ENS node. This will be in JSON format.
     * May only be called from the owner of that node in the ENS registry.
     * @param _node The node to update.
     * @param _nodeKeys The node keys in JSON array format.
     */
    function setNodeKeys(bytes32 _node, string _nodeKeys) public only_owner(_node) {
        komgoRecords[_node].nodeKeys = _nodeKeys;
        emit NodeKeysChanged(_node, _nodeKeys);
    }

    /**
     * Adds a new signing key associated with an ENS node. Increases the pointer of the current signing key
     * May only be called by the owner of that node in the ENS registry.
     * @param _node The node to update.
     * @param _xPublicKey lower 32 bytes of the public key to add.
     * @param _yPublicKey higher 32 bytes of the public key to add.
     * @param _termDate Termination date of the key to add.
     */
    function addKey(bytes32 _node, bytes32 _xPublicKey, bytes32 _yPublicKey, uint _termDate) public only_owner(_node) {
        PublicKey memory publicKey = PublicKey(_xPublicKey, _yPublicKey);
        Key memory key = Key(publicKey, now, _termDate, false);
        komgoRecords[_node].signingKeys.push(key);
        komgoRecords[_node].currentSigningKeyIndex = komgoRecords[_node].signingKeys.length-1;
        emit SigningKeyAdded(_node, _xPublicKey, _yPublicKey, _termDate);
    }

    /**
     * Revokes a signing key (past present or future)
     * May only be called by the owner of that node in the ENS registry or by Komgo.
     * @param _node The node to update.
     * @param _index The index of the signing key to revoke.
     */
    function revokeKey(bytes32 _node, uint _index) public komgoOrOwner(_node) {
        komgoRecords[_node].signingKeys[_index].revoked = true;
        emit SigningKeyRevoked(_node, _index);
    }

    /**
     * Returns the node keys associated with an ENS node.
     * @param _node The ENS node to query.
     * @return a string formatted as a JSON array of the associated nodes public keys.
     */
    function nodeKeys(bytes32 _node) public view returns (string) {
        return komgoRecords[_node].nodeKeys;
    }

    /**
     * Returns the current signing key index associated with an ENS node.
     * @param _node The ENS node to query.
     * @return a index of the current signing key.
     */
    function currentSigningKeyIndex(bytes32 _node) public view returns (uint) {
        return komgoRecords[_node].currentSigningKeyIndex;
    }

    /**
     * Returns the current signing key associated with an ENS node.
     * @param _node The ENS node to query.
     * @param _index The index of the signing key.
     * @return The signing key. Lower 32 bytes of public key, higher 32 bytes of public key, effDate, termDate, revoked
     */
    function currentSigningKey(bytes32 _node, uint _index) public view returns (bytes32, bytes32, uint, uint, bool) {
        Key storage key = komgoRecords[_node].signingKeys[_index];
        return (key.publicKey.x, key.publicKey.y, key.effDate, key.termDate, key.revoked);
    }

    /**
     * Returns the size of the signing keys associated with an ENS node.
     * @param _node The ENS node to query.
     * @return The length of the signing keys array.
     */
    function signingKeysLength(bytes32 _node) public view returns (uint) {
        return komgoRecords[_node].signingKeys.length;
    }

    /**
     * Returns true if the resolver implements the interface specified by the provided hash.
     * @param _interfaceID The ID of the interface to check for.
     * @return True if the contract implements the requested interface.
     */
    function supportsInterface(bytes4 _interfaceID) public pure returns (bool) {
        return super.supportsInterface(_interfaceID) ||
            _interfaceID == NODE_KEYS_INTERFACE_ID ||
            _interfaceID == SIGNING_KEYS_INTERFACE_ID;
    }
}

